import createReactComponent from '../createReactComponent';
var Image = createReactComponent('Image', [['rect', {
  x: '3',
  y: '3',
  width: '18',
  height: '18',
  rx: '2',
  ry: '2',
  key: 'maln0c'
}], ['circle', {
  cx: '8.5',
  cy: '8.5',
  r: '1.5',
  key: 'cn5opk'
}], ['polyline', {
  points: '21 15 16 10 5 21',
  key: '1nv3l3'
}]]);
export default Image;
